Para IOS
1- Em Wi-fi, clique em "Eduroam";
2- Preencha os campos "Nome de usuário" e "Senha" da seguinte maneira: 
Nome de usuário= (seu cpf)@uff.br
Senha= sua senha do idUFF;
3- Clique em "Conectar";
4- Aceite o certificado clicando em "Confiar".

Agora podem aproveitar!❤️

